Pfizer announced Monday that it is investing $120 million to boost production of its COVID-19 treatment pills in the United States. &nbsp;
The move will create more than 250 jobs at its plant in Kalamazoo, Mich., the company said, as it looks to increase production of Paxlovid.&nbsp;
The Michigan plant will become the primary global source of active ingredients for Paxlovid, as the company looks to make 120 million treatment courses this year, Pfizer chief global supply officer Mike McDermott told the Detroit Free Press.

